// App.js
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import InputPage from './Input'; // Import the InputPage component
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Link to="/input">
            <button className="Start-button">Start</button>
          </Link>

          <button className="Records-button">Records</button>
        </header>

        {/* Define the Route for InputPage */}
        <Route path="/input" component={InputPage} />
      </div>
    </Router>
  );
}

export default App;
